import React from "react";
import Todo from "./Todo";
const TodoList = ({ todos, setTodos }) => {
  return (
    <div>
      {todos.map((todo) => {
        console.log(todo.id);
        return (
          <ul>
            <li key={todo.id}>
              <Todo todo={todo} />
            </li>
          </ul>
        );
      })}
    </div>
  );
};

export default TodoList;
